import React, { useState } from 'react';
import './loginForm.css'

function LoginForm() {
  const [token, setToken] = useState('');

  function handleSubmit(event) {
    event.preventDefault();
    // Send the token to a server or do something else with it here
  }

  return (
	<div className='forms'>
	<div className='middle-content'>
	<div>
	<button type='button' className='user-button'>Go back</button>
	</div>
	
	<form  onSubmit={handleSubmit}>
	<div></div>
      <label>
        Token
      </label>
	  <input className='form-group' type="text" value={token} onChange={event => setToken(event.target.value)} />
      <button type="submit">Submit</button>
    </form>
	</div>

  
	</div>

  );
}

export default LoginForm;
